import Navbar from '../components/Navbar/'
// import Link from 'next/Link';

const Index = () => (
           <div>
               <ul>
                   <li><Link href="/"><a>Home</a></Link></li>
                   <li><Link href="/about"><a>About</a></Link></li>
               </ul>
               <h1>Welcome to BitzPrice</h1>
           </div>
        );
export default Index;
